        [TestCleanup]
        public new void TestCleanup()
        {
            FormObjectBase.NavigationMenuSelection(@"System Ops|EDI Data Translations", forceReset: true);
            _ediDataTranslationForm = new EDIDataTranslationsForm(@"EDI Data Translations");

            _ediDataTranslationForm.cmbTranslationType.SetValue(@"System - Operators");
            _ediDataTranslationForm.DoSearch();

            var foundRow = MTNControlBase.FindClickRowInTable(_ediDataTranslationForm.tblTranslations, @"Foreign In^WLA~System Code^ONEY~Foreign Out^WLA", rowHeight: 16, doAssert: false);
            if (foundRow)
            {
                _ediDataTranslationForm.DoDelete();
                _confirmationFormYesNo = new ConfirmationFormYesNo(@"EDI Data Translations");
                _confirmationFormYesNo.btnYes.DoClick();
            }
            _ediDataTranslationForm.DoCancel();
            
            base.TestCleanup();
        }

