        void LoadFileValidateData(string fileName, string tabName, string tabAutomationId, string messageRowToClick, IEnumerable<string> rowDetailsToValidate)
        {
            _ediOperationsForm.LoadEDIMessageFromFile(fileName);
            _ediOperationsForm.ClickEDIDetailsTab();
            _ediOperationsForm.GetTabTableGeneric(tabName, tabAutomationId);
            _ediOperationsForm.TblEDIMessages.FindClickRow(messageRowToClick);

            string detailsNotFound =
                (from rowDetail in rowDetailsToValidate
                    let validationPassed =
                        MTNControlBase.FindClickRowInTable(_ediOperationsForm.tblEDIDetails, rowDetail,
                            clickType: ClickType.None, searchType: SearchType.Exact, doAssert: false)
                    where !validationPassed
                    select rowDetail).Aggregate<string, string>(null,
                    (current, rowDetail) => current + string.Concat(Environment.NewLine, rowDetail));

            Assert.IsTrue(string.IsNullOrEmpty(detailsNotFound), 
                string.Concat($"TestCase44037::LoadFileValidateData - The following validation for file ({fileName}) failed"),
                detailsNotFound);
            
            Wait.UntilInputIsProcessed(waitTimeout: TimeSpan.FromSeconds(5));
        }
